func r()->[Int!]{return readLine()!.characters.split{$0==" "}.map{Int(String($0))!}};var n = Int(readLine()!)!,q = [[Int!]](),p = [[Int!]](),o=n;while 0<o-- {q.append(r())};var m = Int(readLine()!)!;o=m;while 0<o-- {p.append(r())};n-=m;l:for y in 0...n{k:for x in 0...n{for u in 0..<m{for v in 0..<m{if q[y+v][x+u] != p[v][u]{continue k}}};print(y,x);break l}}
